function ListNavigation(props) {
    var start = props.offset - 1;

    const before = Array(2)
        .fill()
        .map(() => (<button>{start++}</button>))

    const after = Array(props.offset - start + 1)
        .fill()
        .map(() => (<button>{start++}</button>))
    
    return (
        <div className="listNav">
            {before}        
            <button>{props.offset + 1}</button>
            {after}
        </div>
    );
} 

export default ListNavigation;
